import React from 'react';
import jwt_decode from "jwt-decode";

function Profile(user_token){
    let username = "";
    if (user_token !== "") {username = jwt_decode(user_token.user_token.username)} 
    return (
        <h1>Bienvenue {username}</h1>
    )
}

export default Profile;
